import React from 'react';

function Home() {
  return (
    <section className="max-w-xl mx-auto flex flex-col md:justify-center px-4 py-8 md:p-8 leading-normal mt-32 mb-24">
      <h1 className="text-6xl mb-0 leading-tight font-mono uppercase text-6xl anime-fadeInUp">
      I build killer experiences</h1>
      <p className="w-full md:w-2/3 font-sans text-purple-lightest text-xl mt-4">
      <div className="content hero-description"><p>Since 2010, I've helped several startups and companies to design and
build their applications, including Twitch, Signal and many others.
When I'm not on my computer, I like to draw trippy stuff and play
boardgames.</p></div></p>
    </section>
  );
}

export default Home;
